import React from "react";
import prodict from "../../utils/data.js";

const MyAppTest = () => {

  return (
    <div style={{ display: "flex" }}>
      <h1>Список продуктов</h1>
      <ul>
        {prodict.map((data) => (
          <li key={data._id}>
            <h2>{data.name}</h2>
            <p>Тип: {data.type}</p>
            <p>Протеин: {data.proteins}</p>
            <p>Жиры: {data.fat}</p>
            <p>Углеводы: {data.carbohydrates}</p>
            <p>Калории: {data.calories}</p>
            <p>Цена: {data.price} руб.</p>
            <img src={data.image} alt={data.name} />
          </li>
        ))}
      </ul>
    </div>
  );
};
export default MyAppTest;
